import logo from './logo.svg';
import './App.css';
import { RouterProvider, createBrowserRouter } from 'react-router-dom';

const browserRouter = createBrowserRouter([
  {
    path: "/",
    element: <div>hi</div>,
  },
]);


const App = () => {
  return <RouterProvider router={browserRouter} />;
}

export default App;
